CREATE TABLE dbo.TABIMBALLI
	(
	CODICE                 VARCHAR (10) NOT NULL,
	DESCRIZIONE            VARCHAR (80) NULL,
	LUNGHEZZA              DECIMAL (16,6) CONSTRAINT DF__TABIMBALL__LUNGH__245D67DE DEFAULT (0) NOT NULL,
	LARGHEZZA              DECIMAL (16,6) CONSTRAINT DF__TABIMBALL__LARGH__25518C17 DEFAULT (0) NOT NULL,
	ALTEZZA                DECIMAL (16,6) CONSTRAINT DF__TABIMBALL__ALTEZ__2645B050 DEFAULT (0) NOT NULL,
	PESOIMBALLO            DECIMAL (16,6) CONSTRAINT DF__TABIMBALL__PESOI__2739D489 DEFAULT (0) NOT NULL,
	DESCRIZIONELINGUA1     VARCHAR (80) NULL,
	DESCRIZIONELINGUA2     VARCHAR (80) NULL,
	DESCRIZIONELINGUA3     VARCHAR (80) NULL,
	DESCRIZIONELINGUA4     VARCHAR (80) NULL,
	DESCRIZIONELINGUA5     VARCHAR (80) NULL,
	DESCRIZIONELINGUA6     VARCHAR (80) NULL,
	DESCRIZIONELINGUA7     VARCHAR (80) NULL,
	DESCRIZIONELINGUA8     VARCHAR (80) NULL,
	DESCRIZIONELINGUA9     VARCHAR (80) NULL,
	UTENTEMODIFICA         VARCHAR (25) NOT NULL,
	DATAMODIFICA           DATETIME NOT NULL,
	CodTipologia           VARCHAR (3) NULL,
	CODNOTE                INT NULL,
	XLS_PACKING            VARCHAR (200) NULL,
	STAMPA_SCHEDASICUREZZA VARCHAR (1) NULL,
	MERCE                  VARCHAR (1) NULL,
	QTA_COLLI              INT NULL,
	LISTINO                DECIMAL (10) NULL,
	VARIANTEIMBALLO        VARCHAR (25) NULL,
	CONSTRAINT PK_TABIMBALLI PRIMARY KEY (CODICE)
	)
